  private final val ZZ_ACTION = zzUnpackAction()

  private final val ZZ_ACTION_PACKED_0 =
    "\2\0\2\1\1\2\1\0\1\1\3\0\1\1\3\0"+
    "\1\1\2\0\1\1\1\0\1\3";

