  def zzUnpackRowMap(packed: String, offset: Int, result: Array[Int]): Int = {
    var i = 0  /* index in packed string  */
    var j = offset  /* index in unpacked array */
    val l = packed.length()
    while (i < l) {
      val high = packed.charAt(i) << 16; i += 1
      result(j) = high | packed.charAt(i); j += 1; i += 1
    }
    j
  }

